import React, { Component } from 'react';
import SignIn from './SignIn';

class LogIn extends Component {
    constructor(props) {
        super(props)
        this.state = {
            typeOf: "SignIn",
        }
    }

    render() {
        if (this.state.typeOf === "SignIn") {
            return (
                <SignIn />
            );
        } else {
            return (
                <SignUp />
            )
        }

    }
}

export default LogIn;
